import React from "react";
import Navbar from "./Navbar";

function Header() {

    return(
       <>
       <div id="main">
           <Navbar />
           <div className="name">
               <h1> 
                   <span> Lunch Your App </span> 
                   With Confidence And Creativity
                </h1>
           </div>
       </div>
       </>
    );

}

export default Header;
